using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A dictation phrase object represents the textual interpretation of a spoken phrase as dictated by a user.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UIDictationPhraseClass/index.html#//apple_ref/occ/cl/UIDictationPhrase"/>    [iOSVersion(5.1)]    public class UIDictationPhrase : NSObject//, AnyObject, NSObjectProtocol    {        /// <summary>        /// An array of alternative textual interpretations of a dictated phrase. (read-only)        /// </summary>        [iOSVersion(5.1)]        [Export("alternativeInterpretations")]        public AnyObject[] AlternativeInterpretations { get; private set; }                /// <summary>        /// The most likely textual interpretation of a dictated phrase. (read-only)        /// </summary>        [iOSVersion(5.1)]        [Export("text")]        public string Text { get; private set; }    }}